import { Form } from "react-bootstrap";
import styled from "styled-components";
import "./App.css";

const Container = styled.div`
  width: 100%;
  display: flex;
  justify-content: center;
  align-items: center;
`;

const Wrapper = styled.div`
padding-top:30px
  background-color: #fff;
  width: 550px;
  height: 650px;
  padding: 30px;
  box-sizing: border-box;
  border-radius: 0px;
  border-style: groove;
`;

const NewTask = () => {
  return (
    <Container>
      <Wrapper>
        <div className="name">
          <label className="Name">Feladat neve</label>
          <input className="input" type="text" name="fullName" />
        </div>
        <div>
          <label className="Name">Feladat leírása</label>
          <input className="input" type="text" name="fullDescription" />
        </div>
        <div>
          <label className="Name">Partner</label>
          <input className="input" type="text" name="partner" />
        </div>
      </Wrapper>
    </Container>
  );
};

export default NewTask;
